John Jackson Miller writes this six-issue miniseries from Marvel's Epic imprint, with art from Steve Ellis. A new individual picks up the helmet of an older Crimson Dynamo - and it wants very badly to be re-united with the armor unit to complete the set once more. Much mayhem ensues as a result.

These are all six issues in original scans, with no credit listed. Thanks to the scanners for their efforts. This fills a request from KAT. Please seed, and enjoy! :-)
